After establishing the underlying transport the client starts sending telemetry data using Export requests. The client continuously sends a sequence of Export requests to the server and expects to receive a response to each request: Request-Response Note: this protocol is concerned with reliability of delivery between one pair of client/server nodes and aims to ensure that no data is lost in-transit between the client and the server. Many telemetry collection systems have intermediary nodes that the data must travel across until reaching the final destination (e.g. application -> agent -> collector -> backend). End-to-end delivery guarantees in such systems is outside of the scope of OTLP. The acknowledgements described in this protocol happen between a single client/server pair and do not span intermediary nodes in multi-hop delivery paths. OTLP over gRPC For gRPC transport OTLP uses Unary RPC to send export requests and receives responses. After sending the request the client MAY wait until the response is received from the server. In that case there will be at most only one request in flight that is not yet acknowledged by the server. Unary Sequential operation is recommended when simplicity of implementation is desirable and when the client and the server are connected via very low-latency network, such as for example when the client is an instrumented application and the server is a OpenTelemetry Service running as a local daemon. The implementations that need to achieve high throughput SHOULD support concurrent Unary calls to achieve higher throughput. The client SHOULD send new requests without waiting for the response to the earlier sent requests, essentially creating a pipeline of requests that are currently in flight that are not acknowledged. Streaming The number of concurrent requests SHOULD be configurable. The maximum achievable throughput is max_concurrent_requests * max_request_size / (network_latency + server_response_time). For example if the request can contain at most 100 spans, network roundtrip latency is 200ms and server response time is 300 ms, then the maximum achievable throughput with one concurrent request is 100 spans / (200ms+300ms) or 200 spans per second. It is easy to see that in high latency networks or when the server response time is high to achieve good throughput the requests need to be very big or a lot concurrent requests must be done. If the client is shutting down (e.g. when the containing process wants to exit) the client will optionally wait until all pending acknowledgements are received or until an implementation specific timeout expires. This ensures reliable delivery of telemetry data. The client implementation SHOULD expose an option to turn on and off the waiting during shutdown. If the client is unable to deliver a certain request (e.g. a timer expired while waiting for acknowledgements) the client SHOULD record the fact that the data was not delivered. Export Response The server may respond with either a success or an error to export requests. The success response indicates telemetry data is successfully processed by the server. If the server receives an empty request (a request that does not carry any telemetry data) the server SHOULD respond with success. When using gRPC transport, success response is returned via ExportResponse message. When an error is returned by the server it falls into 2 broad categories: retryable and not-retryable: Retryable errors indicate that processing of telemetry data failed and the client SHOULD record the error and may retry exporting the same data. This can happen when the server is temporarily unable to process the data. Not-retryable errors indicate that processing of telemetry data failed and the client MUST NOT retry sending the same telemetry data. The telemetry data MUST be dropped. This can happen, for example, when the request contains bad data and cannot be deserialized or otherwise processed by the server. The client SHOULD maintain a counter of such dropped data. When using gRPC transport the server SHOULD indicate retryable errors using code Unavailable and MAY supply additional details via status using RetryInfo containing 0 value of RetryDelay. Here is a sample Go code to illustrate: // Do this on server side. st, err := status.New(codes.Unavailable, "Server is unavailable"). WithDetails(&errdetails.RetryInfo{RetryDelay: &duration.Duration{Seconds: 0}}) if err != nil { log.Fatal(err) } return st.Err() To indicate not-retryable errors the server is recommended to use code InvalidArgument and MAY supply additional details via status using BadRequest . Other gRPC status code may be used if it is more appropriate. Here is a sample Go code to illustrate: // Do this on server side. st, err := status.New(codes.InvalidArgument, "Invalid Argument"). WithDetails(&errdetails.BadRequest{}) if err != nil { log.Fatal(err) } return st.Err() The server MAY use other gRPC codes to indicate retryable and not-retryable errors if those other gRPC codes are more appropriate for a particular erroneous situation. The client SHOULD interpret gRPC status codes as retryable or not-retryable according to the following table: gRPC Code Retryable? CANCELLED Yes UNKNOWN No INVALID_ARGUMENT No DEADLINE_EXCEEDED Yes NOT_FOUND No ALREADY_EXISTS No PERMISSION_DENIED No UNAUTHENTICATED No RESOURCE_EXHAUSTED Yes FAILED_PRECONDITION No ABORTED Yes OUT_OF_RANGE Yes UNIMPLEMENTED No INTERNAL No UNAVAILABLE Yes DATA_LOSS Yes When retrying, the client SHOULD implement a backoff strategy. An exception to this is the Throttling case explained below, which provides explicit instructions about retrying interval. Throttling OTLP allows backpressure signalling. If the server is unable to keep up with the pace of data it receives from the client then it SHOULD signal that fact to the client. The client MUST then throttle itself to avoid overwhelming the server. To signal backpressure when using gRPC transport, the server SHOULD return an error with code Unavailable and MAY supply additional details via status using RetryInfo . Here is a sample Go code to illustrate: // Do this on server side. st, err := status.New(codes.Unavailable, "Server is unavailable"). WithDetails(&errdetails.RetryInfo{RetryDelay: &duration.Duration{Seconds: 30}}) if err != nil { log.Fatal(err) } return st.Err() ... // Do this on client side. st := status.Convert(err) for _, detail := range st.Details() { switch t := detail.(type) { case *errdetails.RetryInfo: if t.RetryDelay.Seconds > 0 || t.RetryDelay.Nanos > 0 { // Wait before retrying. } } } When the client receives this signal it SHOULD follow the recommendations outlined in documentation for RetryInfo: // Describes when the clients can retry a failed request. Clients could ignore
// the recommendation here or retry when this information is missing from error
// responses.
//
// It's always recommended that clients should use exponential backoff when
// retrying.
//
// Clients should wait until `retry_delay` amount of time has passed since
// receiving the error response before retrying. If retrying requests also
// fail, clients should use an exponential backoff scheme to gradually increase
// the delay between retries based on `retry_delay`, until either a maximum
// number of retires have been reached or a maximum retry delay cap has been
// reached. The value of retry_delay is determined by the server and is implementation dependant. The server SHOULD choose a retry_delay value that is big enough to give the server time to recover, yet is not too big to cause the client to drop data while it is throttled. gRPC Service Definition Export requests and responses are delivered using unary gRPC calls. This is OTLP over gRPC Service definition: service UnaryExporter { rpc ExportTraces(TraceExportRequest) returns (ExportResponse) {} rpc ExportMetrics(MetricExportRequest) returns (ExportResponse) {}
} Appendix A contains Protocol Buffer definitions for TraceExportRequest, MetricExportRequest and ExportResponse.

