// Span represents a single operation within a trace. Spans can be
// nested to form a trace tree. Spans may also be linked to other spans
// from the same or different trace and form graphs. Often, a trace
// contains a root span that describes the end-to-end latency, and one
// or more subspans for its sub-operations. A trace can also contain
// multiple root spans, or none at all. Spans do not need to be
// contiguous - there may be gaps or overlaps between spans in a trace.
//
// The next field id is 18.
message Span { // trace_id is the unique identifier of a trace. All spans from the same trace share // the same `trace_id`. The ID is a 16-byte array. An ID with all zeroes // is considered invalid. // // This field is semantically required. If empty or invalid trace_id is received: // - The receiver MAY reject the invalid data and respond with the appropriate error // code to the sender. // - The receiver MAY accept the invalid data and attempt to correct it. bytes trace_id = 1; // span_id is a unique identifier for a span within a trace, assigned when the span // is created. The ID is an 8-byte array. An ID with all zeroes is considered // invalid. // // This field is semantically required. If empty or invalid span_id is received: // - The receiver MAY reject the invalid data and respond with the appropriate error // code to the sender. // - The receiver MAY accept the invalid data and attempt to correct it. bytes span_id = 2; // TraceStateEntry is the entry that is repeated in tracestate field (see below). message TraceStateEntry { // key must begin with a lowercase letter, and can only contain // lowercase letters 'a'-'z', digits '0'-'9', underscores '_', dashes // '-', asterisks '*', and forward slashes '/'. string key = 1; // value is opaque string up to 256 characters printable ASCII // RFC0020 characters (i.e., the range 0x20 to 0x7E) except ',' and '='. // Note that this also excludes tabs, newlines, carriage returns, etc. string value = 2; } // tracestate conveys information about request position in multiple distributed tracing graphs. // It is a collection of TracestateEntry with a maximum of 32 members in the collection. // // See the https://github.com/w3c/distributed-tracing for more details about this field. repeated TraceStateEntry tracestate = 3; // parent_span_id is the `span_id` of this span's parent span. If this is a root span, then this // field must be omitted. The ID is an 8-byte array. bytes parent_span_id = 4; // resource that is associated with this span. Optional. If not set, this span // should be part of a ResourceSpans message that does include the resource information, // unless resource information is unknown. Resource resource = 5; // name describes the span's operation. // // For example, the name can be a qualified method name or a file name // and a line number where the operation is called. A best practice is to use // the same display name at the same call point in an application. // This makes it easier to correlate spans in different traces. // // This field is semantically required to be set to non-empty string. // // This field is required. string name = 6; // SpanKind is the type of span. Can be used to specify additional relationships between spans // in addition to a parent/child relationship. enum SpanKind { // Unspecified. Do NOT use as default. // Implementations MAY assume SpanKind to be INTERNAL when receiving UNSPECIFIED. SPAN_KIND_UNSPECIFIED = 0; // Indicates that the span represents an internal operation within an application, // as opposed to an operations happening at the boundaries. Default value. INTERNAL = 1; // Indicates that the span covers server-side handling of an RPC or other // remote network request. SERVER = 2; // Indicates that the span describes a request to some remote service. CLIENT = 3; // Indicates that the span describes a producer sending a message to a broker. // Unlike CLIENT and SERVER, there is often no direct critical path latency relationship // between producer and consumer spans. A PRODUCER span ends when the message was accepted // by the broker while the logical processing of the message might span a much longer time. PRODUCER = 4; // Indicates that the span describes consumer receiving a message from a broker. // Like the PRODUCER kind, there is often no direct critical path latency relationship // between producer and consumer spans. CONSUMER = 5; } // kind field distinguishes between spans generated in a particular context. For example, // two spans with the same name may be distinguished using `CLIENT` (caller) // and `SERVER` (callee) to identify network latency associated with the span. SpanKind kind = 7; // start_time_unixnano is the start time of the span. On the client side, this is the time // kept by the local machine where the span execution starts. On the server side, this // is the time when the server's application handler starts running. // // This field is semantically required and it is expected that end_time >= start_time. // // This field is required. int64 start_time_unixnano = 8; // end_time_unixnano is the end time of the span. On the client side, this is the time // kept by the local machine where the span execution ends. On the server side, this // is the time when the server application handler stops running. // // This field is semantically required and it is expected that end_time >= start_time. // // This field is required. int64 end_time_unixnano = 9; // attributes is a collection of key/value pairs. The value can be a string, // an integer, a double or the Boolean values `true` or `false`. Note, global attributes // like server name can be set using the resource API. Examples of attributes: // // "/http/user_agent": "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_14_2) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/71.0.3578.98 Safari/537.36" // "/http/server_latency": 300 // "abc.com/myattribute": true // "abc.com/score": 10.239 repeated AttributeKeyValue attributes = 10; // dropped_attributes_count is the number of attributes that were discarded. Attributes // can be discarded because their keys are too long or because there are too many // attributes. If this value is 0, then no attributes were dropped. int32 dropped_attributes_count = 11; // TimedEvent is a time-stamped annotation of the span, consisting of either // user-supplied key-value pairs, or details of a message sent/received between Spans. message TimedEvent { // time_unixnano is the time the event occurred. int64 time_unixnano = 1; // name is a user-supplied description of the event. string name = 2; // attributes is a collection of attribute key/value pairs on the event. repeated AttributeKeyValue attributes = 3; // dropped_attributes_count is the number of dropped attributes. If the value is 0, // then no attributes were dropped. int32 dropped_attributes_count = 4; } // timed_events is a collection of TimedEvent items. repeated TimedEvent timed_events = 12; // dropped_timed_events_count is the number of dropped timed events. If the value is 0, // then no events were dropped. int32 dropped_timed_events_count = 13; // Link is a pointer from the current span to another span in the same trace or in a // different trace. For example, this can be used in batching operations, // where a single batch handler processes multiple requests from different // traces or when the handler receives a request from a different project. // See also Links specification: // https://github.com/open-telemetry/opentelemetry-specification/blob/master/specification/overview.md#links-between-spans message Link { // trace_id is a unique identifier of a trace that this linked span is part of. // The ID is a 16-byte array. bytes trace_id = 1; // span_id is a unique identifier for the linked span. The ID is an 8-byte array. bytes span_id = 2; // tracestate is the trace state associated with the link. repeated TraceStateEntry tracestate = 3; // attributes is a collection of attribute key/value pairs on the link. repeated AttributeKeyValue attributes = 4; // dropped_attributes_count is the number of dropped attributes. If the value is 0, // then no attributes were dropped. int32 dropped_attributes_count = 5; } // links is a collection of Links, which are references from this span to a span // in the same or different trace. repeated Link links = 14; // dropped_links_count is the number of dropped links after the maximum size was // enforced. If this value is 0, then no links were dropped. int32 dropped_links_count = 15; // status is an optional final status for this span. Semantically when status // wasn't set it is means span ended without errors and assume Status.Ok (code = 0). Status status = 16; // child_span_count is an optional number of local child spans that were generated while this // span was active. If set, allows an implementation to detect missing child spans. int32 child_span_count = 17;
} // The Status type defines a logical error model that is suitable for different
// programming environments, including REST APIs and RPC APIs.
message Status { // StatusCode mirrors the codes defined at // https://github.com/open-telemetry/opentelemetry-specification/blob/master/specification/api-tracing.md#statuscanonicalcode enum StatusCode { Ok = 0; Cancelled = 1; UnknownError = 2; InvalidArgument = 3; DeadlineExceeded = 4; NotFound = 5; AlreadyExists = 6; PermissionDenied = 7; ResourceExhausted = 8; FailedPrecondition = 9; Aborted = 10; OutOfRange = 11; Unimplemented = 12; InternalError = 13; Unavailable = 14; DataLoss = 15; Unauthenticated = 16; }; // The status code. This is optional field. It is safe to assume 0 (OK) // when not set. StatusCode code = 1; // A developer-facing human readable error message. string message = 2;
}

